INSERT INTO `courses` (`coursePK`, `courseName`, `courseDesc`, `courseFee`, `courseFeeInt`, `courseLink`) VALUES
(3, 'Professional Certificate for Halal Executive (PCHE)', '<div><div>This 8 days professional program is designed and developed by JAKIM to produce halal executive equipped with theoretical knowledge and practical skills in all phases of organisational halal operation.</div><div><br></div><div>Under the new Malaysia halal certification requirement:</div><div><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\"><br></span></div><div><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">\"Halal executive is compulsory to have a Halal Executive Certificate from JAKIM Certified Training Providers\" (Clause 5.3(a), pg. 10, Malaysian Halal Management System).</span></div></div><div><br><b>Course Outline:</b></div><ol><li><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">Halal Manual and Records Administration</span></li><li style=\"vertical-align: baseline; outline: 0px; padding: 0px; margin: 0px; border: 0px; list-style: decimal outside;\">Internal Halal Committee (IHC) Programme Administration</li><li style=\"vertical-align: baseline; outline: 0px; padding: 0px; margin: 0px; border: 0px; list-style: decimal outside;\">Halal Quality Assurance</li><li style=\"vertical-align: baseline; outline: 0px; padding: 0px; margin: 0px; border: 0px; list-style: decimal outside;\">Halal Certification Process</li><li style=\"vertical-align: baseline; outline: 0px; padding: 0px; margin: 0px; border: 0px; list-style: decimal outside;\">Halal Internal Audit Facilitation</li></ol><p style=\"vertical-align: baseline; outline: 0px; padding: 0px; margin: 0px; border: 0px; list-style: decimal outside;\"><br></p>', 4000, 1000, 'pche'),
(4, 'Professional Certificate for Internal Halal Auditors (PCIHA)', '<p>This 5 days professional program is designed and developed by JAKIM to produce internal halal auditor equipped with theoretical knowledge and practical skills in all phases of internal halal audit activity.</p><p><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">Under the new Malaysia halal certification requirement:</span></p><p><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">a) Internal Halal Auditor should be an individual with Certificate of Internal Halal Auditor/ Halal Executive from JAKIM Certified Training Providers (Clause 5.5(c), pg. 12, Malaysian Halal Management System).</span></p><p><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">b) 3rd party Internal Halal Auditor should be an individual with Certificate of Internal Halal Auditor from JAKIM Certified Training Providers (Clause 5.5(j), pg. 13, Malaysian Halal Management System).</span></p><p><b style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">Course Outline</b></p><ol style=\"vertical-align: baseline; outline: 0px; padding: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 30px; border: 0px; list-style: none;\"><li style=\"vertical-align: baseline; outline: 0px; padding: 0px; margin: 0px; border: 0px; list-style: decimal outside;\">Pre-Audit Meeting Coordination</li><li style=\"vertical-align: baseline; outline: 0px; padding: 0px; margin: 0px; border: 0px; list-style: decimal outside;\">Audit Tools Preparation</li><li style=\"vertical-align: baseline; outline: 0px; padding: 0px; margin: 0px; border: 0px; list-style: decimal outside;\">Opening Meeting</li><li style=\"vertical-align: baseline; outline: 0px; padding: 0px; margin: 0px; border: 0px; list-style: decimal outside;\">Documentation Audit</li><li style=\"vertical-align: baseline; outline: 0px; padding: 0px; margin: 0px; border: 0px; list-style: decimal outside;\">Site Audit</li><li style=\"vertical-align: baseline; outline: 0px; padding: 0px; margin: 0px; border: 0px; list-style: decimal outside;\">Audit Finding Report</li><li style=\"vertical-align: baseline; outline: 0px; padding: 0px; margin: 0px; border: 0px; list-style: decimal outside;\">Closing Meeting</li><li style=\"vertical-align: baseline; outline: 0px; padding: 0px; margin: 0px; border: 0px; list-style: decimal outside;\">Follow-up Audit</li></ol><p><br></p>', 3000, 1000, 'pchia'),
(6, 'Program Kesedaran Halal Premium/ Halal Awareness Premium Program', '<p><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">Program selama 2 hari ini dianjurkan bagi memberikan pendedahan kepada peserta tentang industri halal tempatan dan global, konsep asas halal di dalam Islam serta sistem pensijilan halal malaysia dan penguatkuasaannya. Program ini dianjurkan oleh penyedia latihan yang telah diiktiraf oleh JAKIM.&nbsp;</span><br></p><p><br></p><p>Modul:</p><p>1.<span style=\"white-space:pre\">	</span>Industri Halal</p><p>2.<span style=\"white-space:pre\">	</span>Konsep Halal dan Haram</p><p>3.<span style=\"white-space:pre\">	</span>Sistem Pensijilan Halal Malaysia</p><p>4.<span style=\"white-space:pre\">	</span>Majlis Profesional Halal Malaysia</p><p><br></p><p>The 2 days halal awareness program is organized to give participants exposure to the local and global halal industry, the basic concept of halal in Islam and also the Malaysian halal certification system and its enforcement. The program is organized by JAKIM accredited training providers.&nbsp;</p><p><br></p><p>Course Outline:</p><p>1.<span style=\"white-space:pre\">	</span>Halal Industry</p><p>2.<span style=\"white-space:pre\">	</span>Concept of Halal and Haram</p><p>3.<span style=\"white-space:pre\">	</span>Malaysian Halal Certification System</p><p>4.<span style=\"white-space:pre\">	</span>Malaysian Halal Professional Council</p>', 100, 100, 'PKH'),
(8, 'Seminar Pematuhan MPPHM 2020', '<p>Program selama 1 hari bertujuan untuk memberi kesedaran dan memantapkan pengetahuan tentang MPPHM 2020.</p><p>Program ini memberi pendedahan tentang:</p><ol><li>Pengenalan kepada Manual Prosedur Pensijilan Halal Malaysia (MPPHM) 2020</li><li>Memahami implikasi MPPHM2020 kepada industri halal</li><li>Mengenalpasti perbezaan di antara MPPHM2014 dan MPPHM2020</li><li>Memahami faedah QuikHalal kepada pemegang SPHM bagi mematuhi MPPHM2020</li></ol>', 75, 20, 'mpphm2020'),
(9, 'Halal Competency Program', '<p>This training program is developed to equipped the members of the Internal Halal Committee with the fundamental knowledge and practical experience to manage the entire company\'s halal operation. This 3 days program will be compulsory for all members of Internal Halal Committee under the new MPPHM2020 starting 1 January 2021.</p><p><b>Course Outline</b>:</p><ol><li>Introduction</li><li>Understanding of Sharia\' and Fatwa</li><li>Malaysia Halal Standards</li><li>Manual Procedure for Malaysia Halal Certification (MPPHM)</li><li>Malaysia Halal Management System (MHMS)</li><li>Halal related Legislations</li><li>Critical Ingredients/ Processes</li></ol>', 5000, 3000, 'halalcompetency'),
(10, 'Seminar Pematuhan MS1500:2009 & MS1500:2019', '<p style=\"color: rgb(31, 31, 33); font-family: -apple-system, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 14px;\">Program ini bertujuan untuk pelaksanaan dan pemantuhan MS1500:2009&nbsp;&amp; MS1500:2019<span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">.</span></p><p style=\"color: rgb(31, 31, 33); font-family: -apple-system, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 14px;\"><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">Objektif program:</span></p><p style=\"color: rgb(31, 31, 33); font-family: -apple-system, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 14px;\"><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">1. Implikasi MS 1500 pada industri.</span></p><p style=\"color: rgb(31, 31, 33); font-family: -apple-system, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 14px;\"><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">2. Perbezaan MS 1500:2009 &amp; MS 1500:2019</span></p><p style=\"color: rgb(31, 31, 33); font-family: -apple-system, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 14px;\"><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">3. Pelaksanaan MS 1500:2009 &amp; MS 1500:2019</span></p>', 75, 20, 'SeminarPematuhanMS1500'),
(11, 'Seminar MHMS 2020', '<p style=\"color: rgb(31, 31, 33); font-family: -apple-system, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 14px;\">Program ini bertujuan untuk pelaksanaan dan pemantuhan MHMS 2020<span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">.</span></p><p style=\"color: rgb(31, 31, 33); font-family: -apple-system, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 14px;\"><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">Objektif program:</span></p><p style=\"color: rgb(31, 31, 33); font-family: -apple-system, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 14px;\"><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">1. Pengenalan MHMS 2020</span></p><p style=\"color: rgb(31, 31, 33); font-family: -apple-system, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 14px;\"><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">2.&nbsp;</span>Implikasi MHMS 2020 pada industri halal</p><p style=\"color: rgb(31, 31, 33); font-family: -apple-system, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 14px;\"><span style=\"font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">3. Keperluan umum HAS dan IHCS</span></p>', 75, 20, 'SeminarMHMS2020');
